export class TableTop {
    constructor() {
        this.grid = [
            [null, null, null, null, null],
            [null, null, null, null, null],
            [null, null, null, null, null],
            [null, null, null, null, null],
            [null, null, null, null, null]
        ]
    }
    placeRobot(x, y) {
        let newGrid = [...this.grid][x][y] = "X"
        console.log(newGrid);
    }
}

export class Robot {
    constructor() {
        this.location = null
    }

    place() {
        this.location = [2, 2]
    }
}
